import './App.css';
import {Route, Link} from 'react-router-dom';
import RegistrationPage from './Components/RegistrationPage';
import SignInPage from "./Components/SignInPage";
import HomePage from "./Components/HomePage";
import EditPage from './Components/EditPage';
import DetailsPage from './Components/DetailsPage';
import {Cookies} from "react-cookie";
import PrivateRoute from './Components/PrivateRoute';

function App({state}) {
  const cookies = new Cookies();
  const userId = cookies.get("userId");
  return (
    <div>
      <Route exact path="/" component={SignInPage} />
      <Route exact path="/RegistrationPage" component={RegistrationPage} />
      <PrivateRoute authed={state.authed} exact path="/HomePage" component={HomePage} />
      <PrivateRoute authed={state.authed} exact path="/EditPage" component={EditPage} />
      <PrivateRoute authed={state.authed} exact path="/DetailsPage" component={DetailsPage} />
    </div>
  );
}

export default App;

